    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}{{ title }}{% endblock %}
{% block jumbotron %}
    <h1>{{ title }}</h1>
    <ol class=\"breadcrumb\">
        <li class=\"breadcrumb-item\"><a href=\"{{ path('index') }}\">~</a></li>
        <li class=\"breadcrumb-item active\">{{ title }}_</li>
    </ol>
{% endblock %}
{% block container %}
    <div class=\"row\">
        <div class=\"col-md-4\"></div>
        <div class=\"col-md-4\">
                    <form action=\"\" autocomplete=\"off\">
                        <div class=\"form-group\">
                            <label for=\"username\">Username</label>
                            <input type=\"text\" class=\"login-form-input form-control\" name=\"username\" placeholder=\"Enter username\">
                        </div>
                        <div class=\"form-group\">
                            <label for=\"password\">Password</label>
                            <input type=\"password\" class=\"login-form-input form-control\" name=\"password\" placeholder=\"Enter password\">
                        </div>
                        <br>
                        <button type=\"button\" id=\"sendlogin\" class=\"login-button btn\">log in</button>
                    </form>
        </div>
        <div class=\"col-md-4\"></div>

    </div>
{% endblock %}
{% block footer %}
{% endblock %}", "login/login.html.twig", "/home/patrickeinatz/Dokumente/websites/patrickeinatz/templates/login/login.html.twig");
